import React from 'react';
import { StyleSheet, Text, View, Image, Button } from 'react-native';

export default function App() {

  let title='Get response from server'

  let mainImg = {
    uri: 'https://fontmeme.com/temporary/760ffcebb679896e3b0f872f59338cb2.png'
  };

  function componentDidMount() {
    const response = {

      statusCode: 200,

      headers: {
        'Access-Control-Allow-Origin': '*',
        'Access-Control-Allow-Credentials': true,
      },
      body: 
        fetch('http://ec2-52-14-234-1.us-east-2.compute.amazonaws.com/api', {
          method: 'GET'
        })
        .then((response) => response.json())
        .then((responseJson) => {
            console.log(responseJson);
            title=responseJson
        })
        .catch((error) => {
            console.error(error);
        })
  };

  return (
    <View style={styles.container}>
      <Image source={mainImg} style={styles.image}/>
      <Button title={title} onPress={()=>componentDidMount()}/>
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#EEEEEE',
    alignItems: 'center',
    justifyContent: 'center',
  },

  image: {
    width: 350, 
    height: 300,
    resizeMode: 'contain',
  },
});
}
